import Spacer from "../../../components/Spacer";
import Card from "../../../components/Card";
import CardButton from "../../../components/CardButton";
import Label from "../../../components/Label";
import Button from "../../../components/Button";
import { divide } from "numeral";

const Info: React.FC = ({ text }) => {
  return (
    <>
      <Card className="wing-blank-lg">
        <Spacer size="mmd" />
        <div className="color-grey">我的保险账户</div>
        <div className="wing-blank">
          <Spacer />

          <CardButton className="width-100">
            <Spacer size="sm" />
            <div className="flex-jc-center width-100">
              <div className="flex-jc-center ">
                <img
                  src={require("../../../assets/img/ETH_icon.png")}
                  width="40"
                  height="40"
                  className="margin-right-10"
                />
                USDT
              </div>
              <div className="text-right">
                <div className="font-size-14">20,000</div>
                <div className="color-grey">$ 20,000</div>
              </div>
            </div>
            <Spacer size="sm" />
          </CardButton>

          <Spacer />
          <div className="flex-jc-center">
            <CardButton className="width-47 flex-jc-center">
              <div className="color-grey">TVL</div>
              <div>$ 564,564.68</div>
            </CardButton>
            <CardButton className="width-47 flex-jc-center">
              <div className="color-grey">APY</div>
              <div>102.47%</div>
            </CardButton>
          </div>
          <Spacer />
        </div>

        <Spacer size="mmd" />
      </Card>
      <Spacer />
    </>
  );
};

export default Info;
